import React from "react";
import { Button, Form } from "antd";
import "./supplier.css";

const Supplier = () => {
  const handleClick = () => {};
  return (
    <div className="supplier">
      <div className="flex-box">
        <Button
          type="primary"
          onClick={() => {
            handleClick("add");
          }}
        >
          +Add Supplier
        </Button>
        <Form></Form>
      </div>
    </div>
  );
};

export default Supplier;
